def calc_hash(apiname):
	hash = 0
	apiname = apiname.encode('utf-8')
	for c in apiname:
		hash = (hash * 0xf - c) & 0xFFFFFFFF
	return (hash ^ 0x13c97129) & 0xFFFFFFFF

def find_api_for_hash(req_hash):
	api_lists = {'kernel32.dll' : api_list_kernel32}
	for dllname, api_list in api_lists.items():
		for apiname in api_list:
			ahash = calc_hash(apiname)
			if ahash == req_hash:
				return dllname + '.' + apiname
	return None

if __name__ == '__main__':
	if len(sys.argv) < 2:
		print('please provide a hash')
	else:
		api_hash = int(sys.argv[1], 16)
		api_found = find_api_for_hash(api_hash)
		if api_found:
			print(api_found, "found")
		else:
			print('not found')